function App() {
  const [data, setData] = useState({
    count: 0,
  });

  useEffect(() => {
    console.log('componentDidMount');
    return () => {
      console.log('componentWillUnmount');
    }
  }, [data])

  const updateData= () =>{
      const{count} = data;

      setData({
          count: count +1,
      })
  }

  return (
    <div>
        count = { data.count}<br/>
      <button onClick={updateData}>upDate</button>
    </div>
  );
}

export default App;
